import React, { Component } from 'react';

import classes from './ImageControl.module.css';
import Image from '../Image'

class ImageControl extends Component{
    render(){
        let images = this.props.images.map((image)=>[
             <Image 
             imagePath={image.filePath} 
             key={image.id}/>
        ]);
        return(
            <div className={classes.ImageControl}>
                <Image imagePath={this.props.images[0].filePath} />
                <Image imagePath={this.props.images[1].filePath} />
                <Image imagePath={this.props.images[2].filePath} />
            </div>
        )
    }
} 



export default ImageControl;
